const int VIEW_BLUETOOTHPAIRING_PALETTE[] = {14081505,10734568,9092063,5592405,3050447,2390970,1999821,1932739,16711422,10395294,7763574,6710886,6399705,4868682,3047869,1799864};

#define VIEW_BLUETOOTHPAIRING_DOMINANT_COLOR 8

void
drawView_bluetoothPairing() {

    int i = 0;
    int palette_size = sizeof(VIEW_BLUETOOTHPAIRING_PALETTE) / sizeof(int);
    for (i = 0; i < palette_size; i++){
        ProgramPalette(i, VIEW_BLUETOOTHPAIRING_PALETTE[i]);
    }

    /* 
     * Paint view w/ dominant color using hardware accelerated function to save time
     * - This allows us to call "WriteAPixel()" lesser amount of time.
     * - "WriteAPixel()" is a really slow function.
     */
    DRectangleFill(VIEW_POSITION_X, 
                    VIEW_POSITION_Y, 
                    VIEW_POSITION_X + VIEW_WIDTH, 
                    VIEW_POSITION_Y + VIEW_HEIGHT, 
                    VIEW_BLUETOOTHPAIRING_DOMINANT_COLOR);

    int j = 0;
    for (j = 0; j < (VIEW_WIDTH * VIEW_HEIGHT); j++) {
        if (VIEW_BLUETOOTHPAIRING_PIXELARRAY[j] == (char) VIEW_BLUETOOTHPAIRING_DOMINANT_COLOR)
            continue;
        else
            WriteAPixel(VIEW_POSITION_X + (j % VIEW_WIDTH), VIEW_POSITION_Y + (j / VIEW_WIDTH), (int) VIEW_BLUETOOTHPAIRING_PIXELARRAY[j]);
    }
}
